import React from "react";
import './Banner.css';

const Banner = () => {
  return (
    <div className="banner">
      <div className="banner-content">
        <h1>Good for Growing Brands</h1>
        <p>Book your stall today and reach thousands of potential customers.</p>
        <button className="banner-btn">Book Your Stall</button>
      </div>
    </div>
  );
};

export default Banner;
